{
	"$schema": "https://json.schemastore.org/commitlintrc.json",
	"extends": ["@commitlint/config-angular"],
	"rules": {
		"type-enum": [
			2,
			"always",
			["chore", "build", "ci", "docs", "feat", "fix", "perf", "refactor", "revert", "style", "test", "types"]
		],
		"scope-case": [0],
		"subject-exclamation-mark": [0]
	}
}

{
	"$schema": "https://json.schemastore.org/lintstagedrc.schema.json",
	"*": "prettier --ignore-unknown --write",
	"{src/**,__tests__/**}.{mjs,js,cjs,ts,tsx}": "eslint --fix",
	"src/**.ts": "vitest related --run --config ../../vitest.config.ts"
}

{
	"$schema": "https://biomejs.dev/schemas/1.5.3/schema.json",
	"formatter": {
		"enabled": true,
		"formatWithErrors": false,
		"indentStyle": "tab",
		"indentWidth": 2,
		"lineWidth": 120,
		"lineEnding": "lf",
		"ignore": [
			".turbo",
			".vercel",
			".contentlayer",
			".next",
			"coverage",
			"dist",
			"dist-docs",
			"docs",
			"CHANGELOG.md",
			"tsup.config.bundled*"
		]
	},
	"javascript": {
		"formatter": {
			"enabled": true,
			"quoteStyle": "single",
			"quoteProperties": "asNeeded",
			"trailingComma": "all",
			"semicolons": "always"
		}
	},
	"files": {
		"ignoreUnknown": true,
		"maxSize": 1000000
	}
}

import unocss from '@unocss/eslint-plugin';
import common from 'eslint-config-neon/flat/common.js';
import edge from 'eslint-config-neon/flat/edge.js';
import next from 'eslint-config-neon/flat/next.js';
import node from 'eslint-config-neon/flat/node.js';
import prettier from 'eslint-config-neon/flat/prettier.js';
import react from 'eslint-config-neon/flat/react.js';
import typescript from 'eslint-config-neon/flat/typescript.js';
// import oxlint from 'eslint-plugin-oxlint';
import merge from 'lodash.merge';
import tseslint from 'typescript-eslint';

const commonFiles = '{js,mjs,cjs,ts,mts,cts,jsx,tsx}';

const commonRuleset = merge(...common, { files: [`**/*${commonFiles}`] });

const nodeRuleset = merge(...node, { files: [`**/*${commonFiles}`] });

const typeScriptRuleset = merge(...typescript, {
	files: [`**/*${commonFiles}`],
	languageOptions: {
		parserOptions: {
			warnOnUnsupportedTypeScriptVersion: false,
			allowAutomaticSingleRunInference: true,
			project: ['tsconfig.eslint.json', 'apps/*/tsconfig.eslint.json', 'packages/*/tsconfig.eslint.json'],
		},
	},
	rules: {
		'@typescript-eslint/consistent-type-definitions': [2, 'interface'],
		'@typescript-eslint/naming-convention': [
			2,
			{
				selector: 'typeParameter',
				format: ['PascalCase'],
				custom: {
					regex: '^\\w{3,}',
					match: true,
				},
			},
		],
	},
	settings: {
		'import/resolver': {
			typescript: {
				project: ['tsconfig.eslint.json', 'apps/*/tsconfig.eslint.json', 'packages/*/tsconfig.eslint.json'],
			},
		},
	},
});

const reactRuleset = merge(...react, {
	files: [`apps/**/*${commonFiles}`, `packages/ui/**/*${commonFiles}`],
	rules: {
		'@next/next/no-html-link-for-pages': 0,
		'react/react-in-jsx-scope': 0,
		'react/jsx-filename-extension': [1, { extensions: ['.tsx'] }],
	},
});

const nextRuleset = merge(...next, { files: [`apps/**/*${commonFiles}`] });

const edgeRuleset = merge(...edge, { files: [`apps/**/*${commonFiles}`] });

const prettierRuleset = merge(...prettier, { files: [`**/*${commonFiles}`] });

// const oxlintRuleset = merge({ rules: oxlint.rules }, { files: [`**/*${commonFiles}`] });

export default tseslint.config(
	{
		ignores: [
			'**/node_modules/',
			'.git/',
			'**/dist/',
			'**/template/',
			'**/coverage/',
			'**/storybook-static/',
			'**/.next/',
			'packages/discord.js/',
		],
	},
	commonRuleset,
	nodeRuleset,
	typeScriptRuleset,
	{
		files: ['**/*{ts,mts,cts,tsx}'],
		rules: { 'jsdoc/no-undefined-types': 0 },
	},
	{
		files: [`packages/{api-extractor,brokers,create-discord-bot,docgen,ws}/**/*${commonFiles}`],
		rules: { 'n/no-sync': 0 },
	},
	{
		files: [`packages/rest/**/*${commonFiles}`],
		rules: {
			'n/prefer-global/url': 0,
			'n/prefer-global/url-search-params': 0,
			'n/prefer-global/buffer': 0,
			'n/prefer-global/process': 0,
			'no-restricted-globals': 0,
			'unicorn/prefer-node-protocol': 0,
		},
	},
	{
		files: [`packages/voice/**/*${commonFiles}`],
		rules: { 'no-restricted-globals': 0 },
	},
	{
		files: [`packages/api-extractor-model/**/*${commonFiles}`],
		rules: {
			'@typescript-eslint/no-namespace': 0,
			'no-prototype-builtins': 0,
			'consistent-this': 0,
			'unicorn/no-this-assignment': 0,
			'@typescript-eslint/no-this-alias': 0,
		},
	},
	{
		files: [`packages/api-extractor/**/*${commonFiles}`],
		rules: {
			'consistent-this': 0,
			'unicorn/no-this-assignment': 0,
			'@typescript-eslint/no-this-alias': 0,
		},
	},
	{
		files: [`packages/{api-extractor,api-extractor-model,api-extractor-utils}/**/*${commonFiles}`],
		rules: { '@typescript-eslint/naming-convention': 0 },
	},
	reactRuleset,
	{
		files: [`apps/guide/**/*${commonFiles}`, `packages/ui/**/*${commonFiles}`],
		plugins: { '@unocss': unocss },
		rules: {
			'@unocss/order': 2,
		},
	},
	nextRuleset,
	edgeRuleset,
	{
		files: ['**/*{js,mjs,cjs,jsx}'],
		rules: { 'tsdoc/syntax': 0 },
	},
	prettierRuleset,
	// oxlintRuleset,
);

{
	"$schema": "https://json.schemastore.org/tsconfig.json",
	"extends": "./tsconfig.json",
	"compilerOptions": {
		"emitDeclarationOnly": true,
		"declarationMap": true
	},
	"exclude": ["node_modules"]
}

{
	"$schema": "https://json.schemastore.org/tsconfig.json",
	"extends": "./tsconfig.json",
	"compilerOptions": {
		"allowJs": true
	},
	"include": ["*.ts", "*.tsx", "*.js", ".jsx", ".cjs", "*.mjs"],
	"exclude": ["node_modules"]
}

import type { UserConfig } from 'unocss';
import { defineConfig, presetTypography, presetUno } from 'unocss';

export default defineConfig({
	content: {
		filesystem: ['src/**/*.tsx', 'contentlayer.config.ts', '../../packages/ui/src/lib/components/**/*.tsx'],
	},
	theme: {
		colors: {
			blurple: {
				50: '#e0e3ff',
				100: '#cdd2ff',
				200: '#9ea7ff',
				300: '#7782fa',
				DEFAULT: '#5865F2',
				500: '#3d48c3',
				600: '#293294',
				700: '#1a2165',
				800: '#0e1137',
				900: '#020208',
			},
		},
		fontFamily: {
			sans: 'var(--font-geist-sans)',
			mono: 'var(--font-geist-mono)',
		},
	},
	presets: [
		presetUno({ dark: 'class' }),
		presetTypography({
			cssExtend: {
				pre: {
					padding: '1em',
					'line-height': '1.5',
					'border-radius': '4px',
				},
				code: {
					'font-size': '1em',
					'font-weight': 'unset',
				},
				':where(:not(pre) > code)::before': {
					content: '""',
				},
				':where(:not(pre) > code)::after': {
					content: '""',
				},
				a: {
					color: '#5865F2',
					'text-decoration': 'none',
				},
				'a > img': {
					display: 'inline-block',
				},
				'a > img[height="44"]': {
					height: '44px',
				},
				'div[align="center"] > p > a + a': {
					'margin-left': '0.5em',
				},
				h1: {
					display: 'flex',
					'place-items': 'center',
					'scroll-margin-top': '6.5rem',
				},
				h2: {
					display: 'flex',
					'place-items': 'center',
					'margin-top': '1.25em',
					'scroll-margin-top': '6.5rem',
				},
				h3: {
					display: 'flex',
					'place-items': 'center',
					'margin-top': '1.25em',
					'scroll-margin-top': '6.5rem',
				},
				h4: {
					display: 'flex',
					'place-items': 'center',
					'margin-top': '1.25em',
					'scroll-margin-top': '6.5rem',
				},
				// eslint-disable-next-line id-length
				p: {
					margin: '.5em 0',
				},
			},
		}),
	],
}) as UserConfig;

import { defineConfig } from 'vitest/config';

export default defineConfig({
	test: {
		exclude: ['**/node_modules', '**/dist', '.idea', '.git', '.cache'],
		passWithNoTests: true,
		typecheck: {
			enabled: true,
			include: ['**/__tests__/types.test.ts'],
		},
		coverage: {
			enabled: true,
			all: true,
			reporter: ['text', 'lcov', 'cobertura'],
			provider: 'v8',
			include: ['src'],
			exclude: [
				// All ts files that only contain types, due to ALL
				'**/*.{interface,type,d}.ts',
				'**/{interfaces,types}/*.ts',
				// All index files that *should* only contain exports from other files
				'**/index.{js,ts}',
				// All exports files that make subpackages available as submodules
				'**/exports/*.{js,ts}',
			],
		},
	},
});

/* eslint-disable @typescript-eslint/no-empty-interface */
// This file only exists because of https://github.com/vitejs/vite/issues/9813.
declare interface Worker {}
declare interface WebSocket {}

declare namespace WebAssembly {
	interface Module {}
}
